xible Shipping','Fully customize the shipping cost in your shop, define its calculation rules based on numerous conditions, hide and display the shipping methods and divide orders into separate packages.'=>'W pełni dostosuj koszty wysyłki w swoim sklepie.  Możesz określić reguły ich naliczania w oparciu o wiele warunków, ukrywać i wyświetlać metody wysyłki oraz dzielić zamówienia na osobne paczki.','Live Rates Bundle'=>'Pakiet Stawki Live','Serve your customers the UPS, FedEx, DHL Express or USPS shipping methods with automatically calculated rates and use multiple conditions to display them according to your terms and needs.'=>'Możesz zaoferować swoim klientom metody wysyłki UPS, FedEx, DHL Express lub USPS z automatycznie naliczanymi stawkami i warunkowym wyświetlaniem w zależności od Twoich potrzeb.','UPS Live Rates and Access Points PRO'=>'UPS WooCommerce - Stawki Live i punkty odbioru PRO','WooCommerce UPS integration packed with many advanced features. Display the dynamically calculated live rates for UPS shipping methods and adjust them to your needs.'=>'Integracja WooCommerce UPS z wieloma zaawansowanymi funkcjami. Wyświetl dynamicznie obliczane stawki wysyłki dla metod wysyłki UPS i dostosuj je do swoich potrzeb.','FedEx WooCommerce Live Rates PRO'=>'FedEx WooCommerce Stawki Live PRO','Enable the FedEx live rates for international delivery and integrate it with your shop in less than 5 minutes. Save your time and money – let the shipping cost be calculated automatically.'=>'Zintegruj swój sklep z najpopularniejszym kurierem na świecie. Włącz stawki live oraz automatyczne usługi FedEx w WooCommerce i zapomnij o ręcznej konfiguracji cen wysyłki.','USPS Live Rates PRO'=>'USPS Stawki Live PRO','Serve your customers the automatically and real-time calculated USPS shipping rates. Add the handling fees, insurance and adjust them to your needs with just a few clicks.'=>'Integracja WooCommerce USPS z wieloma zaawansowanymi funkcjami. Wyświetl dynamicznie obliczane stawki wysyłki dla metod wysyłki USPS i dostosuj je do swoich potrzeb.','Flexible Shipping Import / Export'=>'Flexible Shipping Import / Eksport','Use the CSV files to import or export your shipping methods. Edit, update, move or backup the ready configurations and shipping scenarios.'=>'Użyj plików CSV, aby importować lub eksportować swoje metody wysyłki. Edytuj, aktualizuj, przenieś lub utwórz kopię zapasową gotowych konfiguracji i scenariuszy wysyłki.','Flexible Shipping Locations'=>'Flexible Shipping Lokalizacje','Calculate the shipping cost based on location. Define your own custom locations, use the WooCommerce defaults or the ones created by 3rd party plugins.'=>'Twórz reguły wysyłki oparte na lokalizacjach. Różnicuj koszty wysyłki dla grup, pojedynczych krajów lub województw.','Distance Based Shipping Rates'=>'Koszt wysyłki na podstawie odległości','Offer shipping rates based on Distance or Total Travel Time calculated by Google Distance Matrix API and don\'t overpay for shipping.'=>'Uzależnij koszt wysyłki od odległości lub czasu dostawy ze sklepu do klienta.','Pickup Points PRO WooCommerce Plugin'=>'Punkty Odbioru PRO','Provide your customers with multiple carriers\' pickup points at the checkout and let them choose the preferred one to collect their order from.'=>'Oferuj klientom możliwość wyboru punktów odbioru przesyłek od różnych firm kurierskich bezpośrednio podczas finalizacji zamówienia. Dzięki temu klient będzie mógł odebrać zamówienie w najbardziej dogodnym dla siebie miejscu.','Shipping Cost on Product Page PRO'=>'Koszt wysyłki na stronie produktu PRO','Let your customers calculate and see the shipping cost on product pages based on the entered shipping destination and cart contents. Decide how and when exactly you want the shipping cost calculator to display.'=>'Pozwól klientom sklepu obliczyć koszt wysyłki bezpośrednio na stronie produktu. Zdecyduj, jak i kiedy dokładnie chcesz, aby kalkulator kosztów wysyłki był wyświetlany.','Flexible Shipping Box Packing'=>'Flexible Shipping Pakowanie do wysyłki','Use the advanced box packing WooCommerce algorithm to fit the ordered products into your shipping boxes the most optimal way. Configure the shipping cost based on the type and number of the used shipping boxes.'=>'Pozwól algorytmowi pakowania dopasować zamawiane produkty do opakowań wysyłkowych i dobrać ich optymalną konfigurację. Zarządzaj kosztem wysyłki w zależności od typu i ilości użytych opakowań.','Shipping Packages'=>'Shipping Packages','Split the WooCommerce cart content into multiple packages based on various conditions like shipping class.'=>'Podziel koszyk na kilka paczek do wysyłki w oparciu o liczne warunki, takie jak choćby klasa wysyłkowa produktów w koszyku.','Multi Vendor Shipping'=>'Multi Vendor Shipping','Define precisely the shipping cost calculation rules for each Vendor / Product Author in your marketplace or multivendor store.'=>'Zdefiniuj dokładnie zasady obliczania kosztów wysyłki dla każdego sprzedawcy / autora produktu w swoim marketplace lub sklepie typu multivendor.','Delivery Date Picker'=>'Wybór czasu dostawy','Let your customers choose a convenient delivery date for the ordered products and make the shipping cost dependent on the date they choose.'=>'Pozwól klientom wybrać datę dostawy i ustalaj koszt wysyłki dla wybranego przez nich terminu.','DPD UK & DPD Local'=>'DPD UK & DPD Local','Ship your DPD orders faster with advanced DPD UK & DPD Local WooCommerce integration. Gather shipping details, download printable shipping labels and track parcels - everything is automated.'=>'Wysyłaj swoje zamówienia DPD szybciej dzięki zaawansowanej integracji DPD UK & DPD Local WooCommerce. Zbierz szczegóły wysyłki, pobierz drukowalne etykiety wysyłkowe i śledź paczki - wszystko jest zautomatyzowane.','Flexible Printing'=>'Drukowanie PrintNode','Automate your shipping process. Print the shipping labels on thermal printers via PrintNode service. Let the labels be printed automatically the same time the order is placed.'=>'Połącz WooCommerce z drukarkami za pomocą PrintNode. Automatycznie drukuj etykiety nadawcze, faktury, zamówienia i etykiety adresowe.','UPS Labels and Tracking'=>'UPS WooCommerce - Etykiety nadawcze i śledzenie przesyłek','Create the shipments, generate the printable UPS shipping labels for the placed orders and track the parcels directly from your WooCommerce store.'=>'Twórz przesyłki i generuj etykiety wysyłkowe UPS w WooCommerce. Drukuj etykiety i śledź przesyłki UPS bezpośrednio ze swojego sklepu.','DHL Express Live Rates PRO'=>'DHL Express Stawki Live PRO','WooCommerce DHL Express integration packed with many advanced features. Display the dynamically calculated live rates for DHL Express shipping methods and adjust them to your needs.'=>'Integracja WooCommerce DHL Express z wieloma zaawansowanymi funkcjami. Wyświetl dynamicznie obliczane stawki wysyłki dla metod wysyłki DHL Express i dostosuj je do swoich potrzeb.','Canada Post WooCommerce Plugin - Live Rates PRO'=>'Canada Post - Stawki Live','Offer your customers the Canada Post services with real-time calculated shipping rates. Add the handling fees, insurance and adjust them to your needs with just a few clicks.'=>'Zaoferuj swoim klientom usługi Canada Post z kosztami wysyłki naliczanymi w czasie rzeczywistym. Dodaj opłaty manipulacyjne i ubezpieczenie, a następnie dostosuj je do swoich potrzeb kilkoma kliknięciami.','Royal Mail WooCommerce - Live Rates PRO'=>'Royal Mail - Stawki Live','Let your customers choose the Royal Mail shipping methods with the real-time calculated shipping rates. Add the handling fees, insurance and adjust them to your needs in no time.'=>'Oferuj swoim klientom metody wysyłki Royal Mail z kosztami naliczanymi w czasie rzeczywistym. Dodaj opłaty manipulacyjne i ubezpieczenie, a następnie błyskawicznie dostosuj je do swoich potrzeb.','Conditional Shipping Methods'=>'Conditional Shipping Methods','Conditionally display and hide the shipping methods in yo